                            Content = "Altın tarih boyunca hem bir para birimi, hem de bir servet aracı olarak kullanılmıştır. Altın, bazen gümüşle bazen de tek başına bir para standardına da temel teşkil etmiştir (bakınız altın standardı).Bugün özellikle kuyumculuk sektöründe önemli bir hammadde olmasına rağmen halen bir yatırım aracı olarak çekiciliğini sürdürmektedir.Özellikle enflasyonist ve hatta bazı durumlarda deflasyonist beklentilerde yatırımcılar için güvenli liman özelliğine sahip olmaktadır.Altının uluslararası değeri ABD Doları'na karşı belirlenmektedir. Dolayısıyla diğer para birimlerinin altın karşısındaki değeri Altının ABD Doları'nın ilgili para birimi karşısındaki değerinden de etkilenmektedir.Örneğin gram altının Türk Lirası karşısındaki değeri ons altının ABD Doları'na karşı değeri ile ABD Doları/Türk Lirası döviz kurundaki değişimden etkilenmektedir.",
