                        new
                        {
                            Id = 4,
                            CategoryId = 2,
                            Content = "Sistematik risk yatım aracına bağlı olmadığından finansal piyasaların genelini ilgilendirdiğinden portföy çeşitlendirilmesiyle bu riskten kaçınmak mümkün değildir. Ama sistematik olmayan riski yönetebilir ve kontrol edebiliriz. Bunun da en basit yolu bütün yumurtaları aynı sepete koymamak ve farklı yatırım araçlarının bir araya gelmesiyle oluşan bir portföy oluşturmaktır. Böylece sistematik olmayan riski minimize edebiliriz. Beta katsayısı analizi Sharpe tarafından Markowitz Modern Portföy Teorisi’nden yola çıkarak geliştirmiş olduğu Finansal Varlık Fiyatlama Modeli’nin(FVFM – CAPM) belkemiğini oluşturmaktadır.Ekonomideki bazı gelişmeler,finansal piyasalardaki yatırım araçlarının getirisini farklı yönde etkiler.Örneğin,faiz oranlarındaki düşüş,GSYH'nın yükselişi, likidite artışı gibi olaylar, pay (hisse) senetlerine olan talebi dolayısıyla pay senetlerinin fiyatlarını arttırabilir. Faiz oranlarının yükselmesi, döviz fiyatlarındaki artış gibi olaylar, pay senetlerine olan talebi azaltabileceği için fiyatların düşmesine neden olabilir.Beta katsayısı, herhangi bir yatırım aracının finansal piyasalardaki dalgalanmalara karşı duyarlılığının bir ölçüsüdür.Bir başka değişle,yatırım aracının portföy içindeki payının bir birim arttırılması sonucu,portföyün varyans değerinde meydana gelen değişmeyi ifade eder.Yatırımcılar yatarım aracıyle ilgili analizi yaparken, her yatırım aracının kendine özgü,yani finasal piyasalardan bağımsız olan koşullar yanında bu piyasalarla olan bağımlılık derecelerini de incelemelidirler.Portföyün beta katsayısı,tek tek yatırım araçlarının beta katsayılarının ağırlıklı ortalaması olarak tanımlanabilir.Beta katsayısı aşağıdaki formülle gösterilir.ßi = Cov(i, m) / Var(m)Burada i,herhangi bir yatırım aracını,Cov(i, m) o yatırım aracının getirisi ile piyasadaki yatarım araçlarının tümünü kapsayan portföyün getirisi arasındaki kovaryansı,Var(m) piyasa portföyünün getirilerinin varsansını, ßi beta katsayısını ifade etmektedir.Beta katsayısı, bir yatırım aracının getirisinin finansal piyasaların bir bütün olarak getirisine bağlı olarak hangi yönde ve kuvvette değiştiğini gösterir.Portföye alınacak yatırım araçlarının seçiminde,beta katsayısından yararlanılabilirEğer bir yatırım aracının beta katsayısı 1’den büyükse,bu yatırım aracının getirisinde,piyasanın getirisindeki değişme ile aynı yönde ve ondan daha büyük bir değişme olacaktır.Bu tür yatırım araçlarına atak yatırım araçları denir Bu tür yatırım araçlarının piyasaya karşı duyarlılıkları fazladır.Piyasa portföyünün getirinde % 1 artış olduğunda bu yatırım aracının getirinde artış % 1'den fazla olur. Başka bir değişle, piyasa portföyünün getirisinde %1’lik bir düşüş olursa bu yatırım aracının getirisi de %1’den fazla düşer.Eğer bir yatırım aracının beta katsayısı 1 ise, bu yatırım aracının getirisinde,piyasa portföyünün getirisindeki değişme ile aynı yönde ve oranda bir değişme olacaktır.Piyasa portföyünün getirinde % 1 artış olduğunda bu yatırım aracının getirinde de artış % 1 olur.Başka bir değişle, piyasa portföyünün getirisinde % 1’lik bir düşüş olursa bu yatırım aracının getirisi de % 1 düşer.Eğer beta katsaysı sıfır 0 ise yatırım aracının getirindeki değişim ile piyasanın getirisindeki değişme arasında hiç bir ilişki olamayacak,bu yatırım aracını fiyatındaki dalgalanmanın nedenleri tamamıyla sistematik olmayan risk faktörleri olacaktır(böyle bir durum pratikte neredeyse hiç görülmez).Eğer beta katsasyısı sıfır ile 1 arasında bir değer alırsa, yatırım aracının getirisindeki değişim piyasa portföyünün getirisindeki değişimle aynı yönde ama daha az etkilenir olacak demektir.Eğer ßeta - 1’den küçük ise,yatırım aracının getirisinde,piyasa portföyünün getirisindeki değişme ile ters yönde ve ondan daha büyük bir değişme olacaktır.Bu tür yatırım araçlarının piyasaya karşı duyarlılıkları fazladır.Piyasa portföyünün getirinde % 1 artış olduğunda bu yatırım aracının getirinde düşüş % 1'den fazla olur. Başka bir değişle, piyasa p