                        new
                        {
                            Id = 35,
                            CategoryId = 20,
                            Content = "Teşvikleri her kurum veya gerçek kişi v erebilir. Ancak genellikle anlaşılan kamu teşvikleridir. Merkezi hükümetler, yerel yönetimler veya bunlara bağlı olan kamu kurumları belirli ekonomik aktivitelerin yapılmasını sağlamak veya ülkenin belirli bir bölgesinde ekonomik kalkınmanın sağlanması ve işsizliğin azaltılması için şirketleri yatırım yapmaya ikna etmek için teşvikleri kullanırlar.Teşvikler tüm sektörlere verilebildiği gibi sadece bazı sektörler için de verilebilir.Örneğin tarım ve hayvancılığın gelişmesi için verilen sıfır faizli krediler ile destekleme alımları teşvik türlerindendir.Teşvikler yatırımcılara arsa verilmesi, düşük faiz veya sıfır faiz oranlı kredi verilmesi, kamu tarafından alım garantisi verilmesi, kurumlar vergisi ve gelir vergisi uygulamalarında avantajlar,vb.olabilir.Teşvikler aynı zamanda bir maliye politikası araçlarındandır.",
