                        new
                        {
                            Id = 36,
                            CategoryId = 21,
                            Content = "Merkezi Washington, ABD'dir. 1945 yılında kurulmuştur.IMF'nin 1944 yılında 44 ülke temsilcisinin bir araya gelerek imzaladıkları daha sonra Bretton Woods Sistemi olarak da adlandırılan, Birleşmiş Milletler Para ve Maliye Konferansı'nda(United Nations Monetary and Financial Conference) kurulması kararlaştırılmıştır.Bretton Woods Sistemi 1 ons altının fiyatını 35 ABD Doları'na sabitlemişti. Diğer üye ülke para birimlerinin değerleri de ABD Doları'na sabitlenmişti.Sabitlenen kur değerleri üzerinden aşağı ve yukarı yönlerde en fazla % 1'lik dalgalanmaya izin verilmekteydi.Kurların sabitlenmesi ve dış ticaretin liberalleşmesi sonucu oluşabilecek olan dış ticaret dengesizliklerin neden olabileceği ödemeler dengesi problemlerini çözmek için devalüasyon veya revalüasyon yapma zorunluluğuna gerek kalmadan çözüm bulmak amacıyla yapılan anlaşma ile ayrıca IMF adlı bir kurum kurulmasına karar verildi.IMF, ödemeler dengesinde oluşabilecek geçici dengesizlik durumlarında cari açık verebilecek olan ülkelerin kurlarını değiştirmeden onlara kısa vadeli sermaye sağlamak amacıyla görevlendirildi.Sistem bir ülkelerin ödemeler dengesinde ancak yapısal sorunlar oluşması durumunda IMF’nin onayıyla bir para biriminde % 10 devalüasyona veya revalüasyona izin veriyordu.Ancak Bretton Woods sistemi 1970'li yıllarda çöktü. Sistemin çöküşünden sonra IMF'nin misyonu da değişti.IMF'nin ana misyonları şöyle tanımlanabilir:1) Uluslararası para ve finansal sistemin gözetimi, üye ülkelerin ekonomik politikalarının ve mali politikalarının izlenmesi ve üye ülkeler arasında işbirliğinin sağlanması.Bu fonksiyonu nedeniyle küresel düzeyde veya üye ülkelerin herhangi birinde finansal istikrarı bozacak olan olası riskleri belirlemek ve bu konularda tavsiyede bulunmak2) Ödemeler dengesinde sorunlar yaşayacak veya yaşamakta olan ülkelere borç vererek yardımcı olmak. Bu fonksiyon aslında tam da kuruluş misyonuna uygun olandır.Ödemeler dengesinde sorunlar yaşayan ülkelere borç vererek bu ülkelerin para birimlerinin diğer para birimlerine karşı değerlerinde istikrar sağlamayı, bu ülkelerin \"hard currency\" cinsinden döviz rezervlerini güçlendirmeyi, ithalat ödemelerini sürdürmeyi, ekonomik büyümenin olumsuz etkilenmesini önlemeyi sağlamaya çalışmaktadır. Ancak bu desteği sağlarken de sorun yaşayan ülkelerin gerekli istikrar önlemlerini almasını talep etmektedir.3) IMF ayrıca üye ülkelerin ekonomik politikalarını oluşturmada ve mali işlerini daha etkin yürütmelerini sağlamada teknik destek de vermektedir.IMF'nin fonlarını her üye ülkenin küresel ekonomideki büyüklükleriyle orantılı olarak sağlamış oldukları ve taahhüt etmiş oldukları \"hard currency\" denen kaynaklar oluşturmaktadır. Bu kaynaklara kota denmektedir.Kotaların dışında altın ve IMF'nin 1969 yılında yaratmış olduğu özel çekme hakkı (SDR) denen para birimi de vardır.Bu kaynakların dışında ihtiyaç olduğunda IMF ayrıca finansal piyasalardan borçlanabilmektedir.IMF, 1973 Arap - İsrail savaşından sonra ve 1979 İran Devrimi'nden sonra petrol fiyatında görülen hızlı yükselişler ve Bretton Woods Sistemi'nin çöküşünden sonra hızlı yaşanan devalüasyonlar nedeniyle ödemeler dengesinde büyük problemler yaşayan gelişmekte olan ülkelere destek sağlamıştır.Sermaye hareketlerinin serbestleşmesi sonucu 1980'ler ve 1990'larda gelişmekte olan ülkelerde yaşanan krizlerde bu ülkelere fon sağlamış ve istikrar paketlerinin uygulanmasını gözetmiştir.Özellikle Meksika Tekila Krizi, Arjantin, Doğu Asya Bölgesel Krizi, Rusya, Brezilya, 1980, 1994 ve 2001 Türkiye krizlerinin yarattığı sorunların çözümünde ve bu ülkelerin istikrar paketi uygulamalarında önemli rol oynamıştır.2009'da Yunanistan'ın borçlarını ödeyememe problemiyle başlayan ve daha sonra Portekiz, İrlanda ve Kıbrıs Rum Kesimi gibi Avro Bölgesi ülkelerine AB ile birlikte önemli fonlama desteği sağlamıştır.",
