                            Id = 37,
                            CategoryId = 21,
                            Content = "Bir ülkenin uluslararası ticaret rakamları ödemeler dengesinin cari denge alt kaleminde takip edilir. Yurt dışın amal satımına ihracat, yurt dışından mal alımına ithalat denir.Yurtdışı ile yapılan mal ticaretinin yanında turizm,nakliye, müteahhitlik,finansal hizmetler vb.hizmetlerde uluslararası ticaretin konusudur.Uluslararası ticaretin göstergesi olan cari denge rakamlarının yurtiçi gayri safi milli hasıla(GSYH) rakamları üzerinde etkisi vardır.Cari denge açık verdiği zaman GSYH'i azalmakta, fazla verdiği zaman ise GSYH artmaktadır.Bir ülkenin uluslararası ticaret hacmi o ülkenin ne kadar dışarıyla açık olduğunu, yani entegre olduğunu da gösterir.Alım ve satım rakamlarının toplamının GSYH'ye oranı bu göstergeyi sağlar.Uluslararası ticaret ihracat ve hizmet satımı anlamında farklı pazarlarda farklı müşteriler ve pazar payı edinilmesini sağladığı gibi, belirli malların üretimi için gerekli olan ancak ülkede olmayan veya sınırlı miktarlarda bulunan veya üretilen hammaddelerin veya hizmetlerin temin edilmesini sağlar.Uluslararası ticaret ülkeler arası serbest ticaret ile küreselleşme ile de doğrudan ilişkilidir.Özellikle 1989'da Berlin Duvarı'nın çökmesiyle birlikte sermaye hareketlerine olan sınırların kalkması ile birlikte doğrudan yabancı yatırımlar da bir artış yaşanmıştır.Bu artış ile birlikte birçok çokuluslu şirket üretimlerinin bir kısmını değişik ülkelere özellikle kendilerine ucuz işgücü sağlayan ve / veya hammadde kaynaklarını üreten gelişmekte olan ülkelere kaydırmışlardır.Bu kaydırma ile birlikte aynı çokuluslu şirketler bünyesinde kalsa bile ülkeler arasındaki ticaret hacmi artmıştır.",
                            Name = "Uluslararası Ticaret",
                            Seourl = "uluslararasi-ticaret"
                        },
                        new
                        {
                            Id = 38,
                            CategoryId = 22,
                            Content = "Bilanço mantığı açısından baktığımızda, bilanço kalemleri varlıklar (aktifler) ve yükümlülük kalemlerinden oluşurlar. Bilançonun varlık kalemleri sağlanan kaynakların nerelerde kullanıldığını veya nerelere yatırıldığını gösterirler.Varlıkları dönen(cari) varlıklar ve duran varlıklar olarak iki ana gruba ayrılırlar.Dönen varlıklar likiditesi en yüksek olduğu kabul edilen veya bir yıl içinde nakde dönüşebilecek olan varlık kalemleridir.Duran varlıklar kolay nakde dönüşemeyecek veya nakde dönüşebilmesi için 1 yıldan fazla bir zamanın geçmesi gerektiği kabul edilen kalemlerdir.Aslında bir şirketin uzun vadeli yatırımlarını gösterir.Duran varlıklar da devam eden ama tamamlanmamış yatırımlar, maddi duran varlıklar ve maddi olmayan duran varlıklar olarak üçe ayrılabilir.",
                            Name = "Varlıklar",
                            Seourl = "varliklar"
                        },
                        new
                        {
                            Id = 39,
                            CategoryId = 22,
                            Content = "Toplanan vergi gelirleri ile bütçe açığı veren merkezi hükümetlerin kamu harcamalarının bir kısmı karşılanır.Vergiler birer maliye politikası aracı olarak da merkezi hükümetlerce kullanılır.Vergiler doğrudan vergiler ve dolaylı vergiler olarak iki grupta toplanır.",
                            Name = "Vergiler",
                            Seourl = "vergiler"
                        },
                        new
                        {
                            Id = 40,
                            CategoryId = 25,
                            Content = "Bunu bir örnekle açıklayalım. Ev almak istiyoruz ve evin bir bölümünü peşin olarak ödememiz gerekiyor. Ancak bugün itibariyle peşin paramız yok. Bu durumda gelecekte istediğimiz evi alabilmek için peşinatı biriktirmemiz diğer bir deyişle bugün daha az harcamamız gerekir. Biriktirdiğimiz tutar yatırımlarımızı oluşturur. Bugün harcamaktan vaz geçmemiz için bizi motive eden faktör gelecekte alacağımız ev için para biriktirmektir. Biriktirdiğimiz paranın da evi alacağımız güne kadar gelir getirmesini arzu ederiz.Yukarıdaki örneğin yanında bugün tüketim harcaması yapmak yerine bizi yatırıma yönlendiren başka bir sebep de ileride bugüne göre daha fazla tüketim harcaması yapabilecek tutara sahip olacağımızı düşündüğümüzde ortaya çıkar.Yatırımlar reel yatırımlar ve finansal yatırımlar olmak üzere ikiye ayrılır.Örneğimize geri dönersek ev almak için biriktirdiğimiz peşinat finansal yatırımdır.Finansal yatırımlarımızı, mevduat, sabit getirili menkul kıymetler,pay(hisse) senedi,yatırım fonu,emeklilik fonu vb.yatırım araçlarında değerlendiririz.Evi satın aldığımızda finansal yatırımımız artık reel yatırım haline dönüşür.Reel yatırımlara,arazi,makine,fabrika ve sanatsal tablolara yapılan yatırımları örnek verebiliriz.Yaptığımız yatırımlardan çeşitli kazançlar(kayıplar) sağlarız.Bu kazançlar(kayıplar) sermaye kazancı(kaybı) ya da faiz kazancı olarak adlandırılır.Yatırım yapıp yapmamaya risk ve getiri ilişkisi ile karar veririz.",
                            Name = "Yatırım",
                            Seourl = "yatirim"
                        },
                        new
