                            Id = 41,
                            CategoryId = 25,
                            Content = "Bazı durumlarda da bazı sektörlerin rekabet avantajını kaybetmesi sonucu diğer sektörlerde çalışabilecek yetenek ve bilgi düzeyine sahip olamayanlar arasında görülen işsizliktir. En büyük işsizlik sorunu yapısal işsizlik sorunudur. Yapısal işsizliğin uzun sürmesi talep azalması nedeniyle bir ekonominin daha da küçülmesine ve deflasyon problemine sebep olabilir.",
                            Name = "Yapısal İşsizlik",
                            Seourl = "yapisal-issizlik"
                        });
                });

