                    b.HasData(
                        new
                        {
                            Id = 1,
                            CategoryId = 15,
                            Content = "Yükselen bir trendin sonlanmakta olduğunu ve düşen bir trendin başladığını gösterir. Bu formasyonda fiyatlar önce bir tepe yapar ve sol omuz oluşur. Sonrasında daha yüksek bir tepe ile fiyat hareketinin devamı başı oluşturur. Formasyon, üçüncü tepenin (sağ omuz) en yüksek noktalarının ilk tepe ile aynı fiyat seviyelerinde oluştuktan sonra satışların güçlenmesi sonucunda destek seviyesinin (boyun çizgisi) kırılması ile tamamlanmış varsayılır.İlk tepe,oluşan rallide karlarını realize eden yatırımcıların satışları ve talebin azalması ile oluşur.Buradaki geri çekilme ile geç katılımcılar bir alım fırsatı yakaladıkları varsayımıyla alışa geçerler.İkinci  tepe geçici ve kısa bir süre gelen taleple ilk tepenin üstünde oluşur fakat ilk tepede satış fırsatını kaçırdıklarını düşünen yatırımcıların satışları ile fiyat yeni zirveler yapamaz ve buradaki hacim ilk tepeyi oluşturan hacmin altındadır.Sol omuz ile başın dipleri arasındaki çizgi kritik destek seviyesi olan boyun çizgisi(neckline)’dir.Buradan gelen son tepki alışları sol omuz seviyelerinde son bulur ve fiyatlar tekrar boyun seviyesine gelerek sağ omuzu oluşturur.Boyun çizgisi eğimli olabilir ve bazı teknik analizciler aşağıya doğru eğimin formasyonun güvenilirliğini artırdığına inanmaktadırlar.Fiyatların boyun seviyesini en az % 5 aşağı doğru kırması ile formasyon tamamlanmış olur.Destek seviyesi kırıldıktan sonra fiyatın H boyu kadar gitmesi hedeflenir.Oluşumların vadesi 3 - 4 haftadan birkaç yıla kadar sürmektedir. ",
                            Graphic = "formasyon1.png",
                            Name = "Omuz Baş Omuz Formasyonu",
                            Seourl = "omuz-bas-omuz"
                        },
                        new
                        {
                            Id = 2,
                            CategoryId = 20,
                            Content = "Düşüş trendinin sonunda oluşan yüksek güvenilirlikli bir dip formasyonudur. Oluşum kuralları omuz baş omuz formasyonu ile aynıdır ve omuz baş omuz formasyonunun simetriği gibi görünür. Burada da hacim öneli bir kriterdir. İlk dipte oluşan hacim ortadaki dip seviyesinden yüksektir ve son dip seviyesinin hacmi ilk iki dip seviyesini oluşturan hacmin 1,5 – 2 katı olmalıdır. ",
