                        },
                        new
                        {
                            Id = 3,
                            CategoryId = 3,
                            Content = "Trend dönüşlerinde önemli sinyallerdir. “M” harfine benzemektedirler. Fiyatların aynı zirve seviyeleri iki kez test etmesi ile oluşurlar. İşlem hacmi ilk tepede, ikinciye nispeten daha yoğundur. Çift tepeler ana trend değişim formasyonlarıdır ve iki tepenin oluşması arasındaki süre 2-3 ay sürebilir. İki tepe arasındaki yükseklik farkı %3 olabilir. Bu formasyonda da destek seviyesinin kırılması ile fiyatın H boyu kadar düşmesi beklenir.",
