                            CategoryId = 3,
                            Content = "Çanak formasyonları düşen  piyasa dönüşlerinde, Ters Çanak Formasyonları ise yükselen piyasa dönüşlerinde görülmektedir. Çanak Formasyonu genellikle varlık fiyatının ucuz olduğu, Ters Çanak Formasyonu ise varlıkların yüksek fiyatlandığı piyasalarda görülür.Çanak formasyonunda fiyatlar bir dip çalışması yaparak bir süre yatay harekette bulunur.Bu hareket sırasında işlem hacmi azalarak çanağın orta seviyesinde en düşük seviyesine geriler.Sonraki süreçte alışlar düşük ivmeyle artmaya başlar ve fiyatlar direnç seviyesine doğru seyreder.Fiyatların direnç seviyesini kırması ile formasyon tamamlanmış varsayılır.Çanak formasyonlarıın tersidir.Zirve seviyelerinde oluşurlar.İşlem hacmi, formasyon oluşumunu tamamladıkça azalmaktadır.Fiyatların artması ve düşmesi simetrik olmalıdır.",
