                            CategoryId = 19,
                            Content = "Her tepenin bir öncekinden daha alt seviyede, her desteğin ise bir öncekinden daha üst seviyede oluşması ile ortaya çıkarlar. Çizgi çalışması yapılırken iki direnç ve iki destek noktasına temas etmesi istenir. Fiyatlar bu iki çizgi arasında gittikçe sıkışmaya başlar. Formasyon üçgenin kırılması ile tamamlanmış olur ve bu kırılma anından sonra pozisyona girilir. Kırılmanın %3 - %5 oranında olması güveni artıracaktır. Tercih edilen ise kırılmanın yükselen işlem hacmi ile onaylanmasıdır. Genellikle trendin devamı şeklinde kırılırlar. Fiyatın üçgenin dip ve tepe seviyesi farkı kadar gitmesi gerekir aksi takdirde formasyonun başarısızlığa uğradığı kabul edilerek pozisyonlar kapatılır.",
