                            Id = 12,
                            CategoryId = 2,
                            Content = "Oldukça sık görülen formasyon türleridir ve ortaya çıkış şekilleri birbirine oldukça benzer. Hacimle desteklenen sert bir piyasa hareketinden sonra gelen duraksama anlarını gösterirler. Fiyatlar bir süre konsolide olduktan sonra aynı yönlü hareketini devam ettirme eğilimindedir. Yükselen trendde oluşumları 5 gün ile 1-3 hafta arasında tamamlanırken aşağı trendlerde bu süre 1-2 haftadır. Flama formasyonlarının oluşumları, bayrak formasyonlarına göre daha kısa sürelidir. Spekülatif varlıklarda daha sık görülmektedirler. Yükselen bir piyasada hafif aşağı eğimli, düşen bir piyasada hafif yukarı eğimli olabilirler. Formasyon oluşmadan önce gelen hareket “bayrak direği” olarak adlandırılır ve kırılma anından sonra fiyatın bu uzunluk kadar gitmesi beklenir. ",
                            Graphic = "formasyon13.png",
                            Name = "Bayrak ve Flama Formasyonları",
                            Seourl = "bayrak-ve-flama"
                        },
                        new
                        {
                            Id = 13,
                            CategoryId = 25,
                            Content = "Fiyatların artmasına rağmen talep gittikçe azalmaktadır. Alçalan ya da yükselen trendlerde görülebilirler. Destek,  direnç seviyesine göre daha dik olmaktadır. Formasyonun yukarı yönlü olması, kırılmanın yukarı yönlü olabileceği gibi bir beklentiye neden olsa da bu çok doğru değildir. Kırılmadan sonra formasyonun oluşumunu tamamladığı varsayılır.",
                            Graphic = "formasyon14.png",
                            Name = "Yükselen Takoz Formasyonu",
                            Seourl = "yukselen-takoz"
                        },
                        new
                        {
                            Id = 14,
                            CategoryId = 1,
                            Content = "Destek ve direnç çizgileri de aşağı eğilimli olmasına rağmen, direnç daha diktir. Kırılmanın yukarı yönlü olması daha sık görülen bir durum olsa da kırılmadan sonraki hareketin büyüklüğü hakkında fikir yürütmek zordur.",
                            Graphic = "formasyon15.png",
                            Name = "Alçalan Takoz Formasyonu",
                            Seourl = "alcalan-takoz"
                        },
                        new
                        {
                            Id = 15,
                            CategoryId = 5,
                            Content = "Genellikle piyasanın tepelerinde görülen bir ana trend formasyonudur. Gittikçe genişleyen ve gittikçe daralan iki üçgenin birleşimi gibi görünür. Oluşumları birkaç ayı bulabilir. Bu süre içerisinde görülen hareketler nispeten daha volatildir. Ölçümleme işlemleri üçgen formasyonlarına benzer. Kırılmadan   sonra fiyatın, formasyonun en dip ve en üst seviyesi arasındaki fark kadar hareket etmesi beklenir.",
                            Graphic = "formasyon16.png",
                            Name = "Elmas Formasyonu",
                            Seourl = "elmas"
                        },
                        new
                        {
                            Id = 16,
                            CategoryId = 4,
                            Content = "Üçgen formasyonları gibi dinlenme alanlarını gösterirler. Farklı olarak zirveler ve dipler aynı fiyat seviyelerinde oluşur ve bu seviyeleri birleştiren doğrular birbirine paraleldir. Bu formasyon düşüş trendinde yukarı eğilimli, yükseliş trendinde aşağı eğilimli olabilir. Formasyonun oluşma süreci gittikçe azalan bir işlem hacmi ile tamamlanır ve kırılmadan sonra gelen hareketin dikdörtgenin yüksekliği kadar olması beklenir.",
